  <script defer="" src="./React App_files/bundle.js"></script><style>.App{
    position: relative;
}

*{
    padding:0;
    margin: 0;

}

body{
    display: flex;
    flex-direction: column;
    align-items: center;
    background-color: rgb(1, 0, 32);
    font-family: "roboto";
    position: relative;
}

img{
    /* max-width: 100%; */
    width: 1905px;
    
    

}


.imgInRules{
    width: 5rem;
    border: 2px solid white;
    box-shadow: 1px 1px 7px rgb(0, 0, 0);


}

.rulesContainer{
    display: flex;
    flex-direction: column;
    gap:1rem
}

#pregameContainer{
    position: fixed;
    top: 30%;
    border: 3px solid rgb(255, 255, 255);
    padding: 1.5rem;
    /* background-color:  rgb(255, 255, 255); */
    left:0;
    right:0;
    margin-left: auto;
    margin-right: auto;
    width: 25rem;
    height: max-content;
    display: block;
    background-color: #808080;
    display: flex;
    flex-direction: column;
    gap: 1rem;
}

.characterToFind{
    display: flex;
    color: rgb(29, 29, 29);
    align-items: center;
    gap: 4rem;
    justify-content: center;
    font-weight: 900;
    font-style: oblique;
    font-size: 20px;
 
}

.mainRule{
    text-align: center;
    font-size: 26px;
    font-weight: 800;
    color: rgb(1, 0, 32);
}

hr{
    height: 2px;
    background-color: rgb(1, 0, 32);
    border: none;
}

#characterSelectContainer{
    background-color: rgba(14, 14, 14, 0.7);
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
}

#targetArea{
    border-radius: 90px;
    background-color: transparent;
    border: 8px solid rgb(252, 66, 66);
    background-color: rgba(94, 94, 94, .4);
    
}

.selection{
    font-weight: bold;
    color: white;
    border:2px solid #808080;
    width: 100%;
    text-align: center;
    padding: .2rem;
    box-sizing: border-box;
    cursor:pointer;
}

.selection:hover{
    background-color: rgba(11, 99, 214, 0.6);
}
